    false,nt"url": null,nt"notes": "These data identify the areas (in general)
    of critical habitat designated for the arroyo toad. NOTE: THIS DATA SET INCLUDES
    APPROXIMATELY 900 ACRES OF LAND INADVERTENTLY OMMITTED FROM THE MAPS AND LEGAL DESCRIPTIONS
    FOR UNITS 8, 10, 11, AND 14 IN THE FINAL RULE PUBLISHED ON FEBRUARY 9, 2011 (76FR7246).
    UNTIL A CORRECTION OF THE FINAL RULE IS PUBLISHED THE BOUNDARIES OF UNITS 8, 10,
    11 AND 14 SHOULD BE CONSIDERED PROVISIONAL. These data reflect revisions to the
    proposal published in the Federal Register on October 13, 2009 (74FR52614). Critical
    habitat for the species consists of approximately 98,000 acres among 22 units from
    San Diego County northward to Santa Barbara County, California. Descriptions of
    the units and all area calculations contained in the rule published in the Federal
    Register on February 9, 2011 (76FR7246) are consistent with the boundaries contained
    in this data set.",nt"license_title": null,nt"extras": [{ntt"key":
